(window.webpackJsonp=window.webpackJsonp||[]).push([[13],{S6uJ:function(e,t,a){"use strict";var i=a("KQm4"),r=a("q1tI"),o=a.n(r),s=a("9Koi"),n=a("XSxc"),c=a("jsr+"),u=a("Bl7J"),l=a("vrFN"),d=a("K4iA"),m=a("qoe/"),p=a("5I0T"),f=a.n(p);t.a=e=>{let{lang:t,title:a,seoDescription:r}=e;const{t:p}=Object(s.a)(),h=m[t]||m.en;return o.a.createElement(u.a,null,o.a.createElement(l.a,{lang:t,title:a,description:r,keywords:[].concat(Object(i.a)(f.a),["faq","frequently asked questions","ukk","usein kysytyt kysymykset"])}),o.a.createElement(c.a,{className:"container link spacing spacing--after"},o.a.createElement(d.a,{className:"spacing--after-small",headingLevel:"h1",text:p("faqPage:faqTitle")}),h.map(e=>o.a.createElement(n.a,{track:!0,key:e.title,title:e.title,content:e.text}))))}},"qoe/":function(e){e.exports=JSON.parse('{"fi":[{"title":"Miten kurssille ilmoittaudutaan?","text":["Kurssille ei tarvitse varsinaisesti ilmoittautua ennen kuin haluat tehdä kurssin kokeen ja tarvitset virallisen suoritusmerkinnän. Koe tehdään Avoimen yliopiston Moodle-järjestelmään. Katso lisää <a href=\'/osa0/yleista#osat-ja-suorittaminen\'>täältä</a>."]},{"title":"Mikä on kurssin laajuus?","text":["Kurssin laajuus on <a href=\'/osa0/yleista#osat-ja-suorittaminen\'>riippuen tekemiesi tehtävien määrästä</a> 5-14 opintopistettä. Suoritettuasi kurssin voit jatkaa aihepiiriin syventymistä 1-10 opintopisteen laajuisen <a href=\'/osa0/yleista#full-stack-harjoitustyo\'>Full stack -harjoitustyön</a> parissa."]},{"title":"Milloin on tehtävien ja kokeen deadline?","text":["Etenemisnopeus on vapaa."]},{"title":"Miten tehtävät palautetaan?","text":["Tehtävät palautetaan GitHubin kautta ja merkitsemällä tehdyt tehtävät palautussovellukseen, lue lisää <a href=\'/osa0/yleista#tehtavien-palauttaminen\'>täältä</a>."]},{"title":"Pitääkö jokainen osa palauttaa omaan repositorioon?","text":["Ei. Voit käyttää yhtä tai useampaa repositoriota, tärkeintä on, että asiat repositorion sisällä ovat selkeästi nimettyjä."]},{"title":"Voinko muokata tekemääni palautusta?","text":["Et. Kaikki osan tehtävät on palautettava kerralla. Jos merkkasit tehtäviä vahingossa väärin tai typotit repositorion nimen, lähetä mailia osoitteeseen matti.luukkainen@helsinki.fi tai viesti Discordissa käyttäjälle <i>mluukkai</i>, kerro viestissä github-käyttäjätunnuksesi sekä se mitä ja miten palautusta on muutettava"]},{"title":"Milloin ja miten saan kurssilta suoritusmerkinnän?","text":["Saat suoritusmerkinnän sen jälkeen kun olet tehnyt hyväksyttävään suoritukseen oikeuttavan määrän tehtäviä, suorittanut kokeen hyväksytysti ja ilmoittanut palautussovelluksessa olevasi valmis kurssin suorituksen kanssa. Lue lisää <a href=\'/osa0/yleista#osat-ja-suorittaminen\'>täältä</a>."]},{"title":"Voinko laajentaa aiempaa kurssisuoritustani?","text":["Voit, lue lisää <a href=\'/osa0/yleista#aiemmin-suoritetun-kurssin-taydentaminen\'>täältä</a>"]},{"title":"Kuulin että suorittamalla kurssin on mahdollista päästä työhaastatteluun","text":["Pitää paikkansa, jos suoritat täydellä laajuudella kurssin ja siihen liittyvän 10 op:n laajuisen harjoitustyön, pääset yhteistyökumppaniemme työhaastatteluun, lue lisää <a href=\'/osa0/yleista#haastattelulupaus\'>täältä</a>."]}],"en":[{"title":"What are the prerequisites of the course?","text":["See <a href=\'/en/part0/general_info#prerequisites\'>here</a>."]},{"title":"How much does this course cost?","text":["The course is totally free of charge. You can get a certificate and even the University of Helsinki ECTS credits for free. See <a href=\'/en/part0/general_info#parts-and-completion\'>here</a> for more info."]},{"title":"How do I sign up for the course?","text":["You don\'t have to sign up until you want to do the course exam. You can find more information <a href=\'/en/part0/general_info#parts-and-completion\'>here</a>. <br><br>For the course certificate signup is not needed."]},{"title":"How many credits is the course?","text":["The course is 5-14 ECTS credits <a href=\'/en/part0/general_info#parts-and-completion\'>depending on the amount of exercises made</a>. After completing the course you can continue to deepen your knowledge on the subject matter by doing the 1-10 ECTS credit <a href=\'/en/part0/general_info#full-stack-project\'>Full Stack project</a>."]},{"title":"When is the deadline for the exercises and the exam?","text":["You can complete the course at your own pace and there are no deadlines for anything. See <a href=\'/en/part0/general_info/#no-more-yearly-versions\'>this</a> for more details."]},{"title":"How do I submit the exercises?","text":["The exercises are submitted to GitHub, and by marking the exercises as done in the exercise submission system. You can read more from <a href=\'/en/part0/general_info#submitting-exercises\'>here</a>. "]},{"title":"Do I have to submit each part to a separate repository?","text":["No. You can use one or more repositories, the most important thing is to name everything clearly."]},{"title":"Can I edit a submission?","text":["No. All exercises for a part must be submitted at the same time. If you marked exercises wrong by accident, or wrote the repository name wrong, send an e-mail to matti.luukkainen@helsinki.fi or message in Discord to <i>mluukkai</i>, tell your GitHub username and how the submission should be edited."]},{"title":"When and how can I get my credits?","text":["You can get your credits after submitting enough exercises for passing the course, passing the course exam and letting us know through the exercise submission system that you finished the course.<br><br>For the course certificate signup or the exam are not needed."]},{"title":"Do I get a certificate after completing the course?","text":["Yes! You can download the certificate after completing the course from the exercise submission system. For the course certificate signup to Open university and the exam are not needed."]},{"title":"Should I signup to Open University to get the course certificate?","text":["For the course certificate signup to Open University is not needed. You can download the certificate after completing the course from the exercise submission system."]},{"title":"I started the course last year, how should I continue?","text":["Read more from <a href=\'/en/part0/general_info#expanding-on-a-previously-completed-course\'>here</a>"]},{"title":"I heard that I could get a job interview by completing the course.","text":["That\'s right. If you complete the course with full credits, and complete the practical work with 10 credits, you get a job interview with our partners. Read more <a href=\'/en/part0/general_info#interview-promise\'>here</a>. You need to be a resident of Finland in order to participate in these interviews."]}],"es":[{"title":"Cuales son los pre-requisitos del curso?","text":["Mira <a href=\'/es/part0/informacion_general#requisitos-previos\'>aquí</a>."]},{"title":"¿Cuanto cuesta este curso?","text":["El curso es completamente libre de cargo. Puedes obtener un certificado e incluso los créditos ECTS de la universidad de Helsinki. Puedes encontrar más información <a href=\'/es/part0/informacion_general#partes-y-finalizacion\'>aquí</a>"]},{"title":"¿Cómo me registro en el curso?","text":["No tienes que registrarte hasta que quieras hacer el examen del curso. Puedes encontrar más información <a href=\'/es/part0/informacion_general#partes-y-finalizacion \'>aquí</a>. <br><br>Para el certificado del curso, no es necesario registrarse."]},{"title":"¿Cuántos créditos tiene el curso?","text":["El curso es de 5-14 créditos ECTS <a href=\'/es/part0/informacion_general#partes-y-finalizacion\'> dependiendo de la cantidad de ejercicios hechos</a>. Después de completar el curso, puedes continuar profundizando tus conocimientos sobre el tema haciendo el <a href=\'/es/part0/informacion_general#proyecto-full-stack\'>proyecto Full Stack</a> por 1-10 créditos ECTS."]},{"title":"¿Cuándo es la fecha límite para los ejercicios y el examen?","text":["Puedes completar el curso a tu propio ritmo y no hay fechas limite para nada. Para más detalles puedes leer <a href=\'/en/part0/general_info/#no-more-yearly-versions\'>esto</a>"]},{"title":"¿Cómo envío los ejercicios?","text":["Los ejercicios se envían a GitHub y se marcan los ejercicios como realizados en el sistema de envío de ejercicios. Para más detalles puedes leer <a href=\'/es/part0/informacion_general#envio-de-ejercicios\'>esto</a>."]},{"title":"¿Tengo que enviar cada parte a un repositorio separado?","text":["No. Puedes usar uno o más repositorios, lo más importante es que nombres todo claramente"]},{"title":"¿Puedo editar el envío de una parte?","text":["No. Todos los ejercicios de una parte deben enviarse al mismo tiempo. Si has marcado los ejercicios incorrectamente por accidente o escribiste el nombre del repositorio incorrectamente, envía un correo electrónico a matti.luukkainen@helsinki.fi o envía un mensaje en Discord a <i>mluukkai</i>, menciona tu nombre de usuario de Github y como el envío debería ser editado"]},{"title":"¿Cuándo y cómo puedo obtener mis créditos?","text":["Puedes obtener tus créditos después de enviar suficientes ejercicios para aprobar el curso, aprobar el examen del curso e informarnos a través del sistema de envío de ejercicios que has terminado el curso.<br><br>Para el certificado del curso, no es necesario registrarte o hacer el examen"]},{"title":"¿Recibo un certificado después de completar el curso?","text":["¡Sí! Puedes Puedes descargar el certificado después de completar el curso, desde el sistema de envío de ejercicios. Para el certificado del curso, no es necesario registrarse en Open university ni hacer el examen."]},{"title":"¿Debo registrarme en Open University para obtener el certificado del curso?","text":["Para el certificado del curso, no es necesario registrarse en Open University. Puedes descargar el certificado después de completar el curso desde el sistema de envío de ejercicios"]},{"title":" Comencé el curso el año pasado, ¿cómo debo continuar? ","text ":["Más información <a href=\'/es/part0/informacion_general#ampliacion-de-un-curso-completado-anteriormente\'>aquí</a>"]},{"title":"Escuché que podría obtener una entrevista de trabajo completando el curso","text ":["Así es. Si completas el curso con créditos completos y completas el trabajo práctico con 10 créditos, obtendrás una entrevista de trabajo con nuestros socios. Leer más <a href=\'/es/part0/informacion_general#promesa-de-entrevista\'>aquí</a>. Necesitas ser un residente de Finlandia para participar en estas entrevistas."]}],"zh":[{"title":"我如何报名这门课程呢？","text":["除非你想参加课程考试，否则你并不必报名。 考试是在开放大学的 Moodle 系统中完成的。 在<a href=\'/zh/part0/基础知识#parts-and-completion\'>这里</a>.你可以找到更多资料。<br><br>请注意，只有拥有芬兰社保账号的人才能参加考试并获得官方的 ECTS 学分。 <br><br>而对于课程证书，不需要报名或芬兰社保号码。"]},{"title":"这门课多少学分呢？","text":["该课程为5-14个ECTS学分，这<a href=\'/zh/part0/基础知识#parts-and-completion\'>取决于您提交的练习次数</a>。 完成课程后，您可以通过进行<a href=\'/zh/part0/基础知识#full-stack-project\'> Full Stack项目</a>来加深对课程内容的了解，从而获得1-10 ECTS学分。 <br><br>请注意，只有具有芬兰社保号码的人才能获得ECTS官方积分。 <br><br>对于课程证书，不需要注册或芬兰社保号码。"]},{"title":"练习与考试的截止日期是什么时候呢？","text":["您可以按照自己的进度完成课程。 提交练习的截止日期但是2023年3月1日的23点59分59秒，如果你想要获得公开大学的学分，截止日期为2023年1月10日的23点59分59秒。 请记住，您必须在截止日期的前一天，即2023年1月9日报名参加考试。"]},{"title":"我如何提交练习作业呢？","text":["练习将提交到GitHub，并在练习提交系统中将练习标记为完成。 您可以从<a href=\'/zh/part0/基础知识#submitting-exercises\'>这里</a>阅读更多相关内容。"]},{"title":"我需要为每次提交都创建一个代码仓库吗？","text":["不需要。您可以使用一个或多个代码仓库，最重要的是清楚地描述仓库中的所有内容。"]},{"title":"我能重新编辑我的提交吗？","text":["不可以。每部分的所有练习必须一起提交。如果你不小心将练习提交错了，或者把仓库名字写错了，给 matti.luukkainen@helsinki.fi 这个邮箱发送一个说明或者给<i>mluukkai</i>的Discord发消息。在邮件中注明你的github用户名并说明提交如何编辑。"]},{"title":"我什么时候，以及如何获得自己的学分呢？","text":["当你提交足够的练习，达到课程通过标准后，通过了课程考试，并通过练习提交系统告知我们所有准备已经妥当，才能获得学分。 截止日期是2023年1月10日。在<a href=\'/zh/part0/基础知识#parts-and-completion\'>此处</a>了解更多信息。 <br><br>请注意，只有具有芬兰社保号码的人才能获得ECTS官方积分。 <br><br>对于课程证书，不需要注册或芬兰社保号码。"]},{"title":"在我完成这门课程后能够获得结业证书吗？","text":["是的！您可以从练习提交系统中完成课程后下载证书。 对于课程证书，不需要注册公开大学和芬兰的社保号码。"]},{"title":"为了获得课程的结业证书，我需要芬兰的社保号码吗？","text":["对于课程结业证书来说，不需要芬兰社保号码。 完成课程后，您可以从练习提交系统下载证书。"]},{"title":"为了获得课程的结业证书，我需要注册公开大学吗？","text":["对于课程结业证书来说，不需要注册公开大学。 完成课程后，您可以从练习提交系统下载证书。"]},{"title":"我是从去年的课程开始学习的，我应该怎么续接今年的课程呢？","text":["阅读更多 <a href=\'/zh/part0/%E5%9F%BA%E7%A1%80%E7%9F%A5%E8%AF%86#expanding-on-a-previously-completed-course\'>这一章节</a>的内容。"]},{"title":"我听说完成这么课程后可以获得工作面试。","text":["没错。如果你活得了本门课程的全部学分，并完成了实践作业的10学分，你可以获得我们合作伙伴的工作面试。阅读<a href=\'/zh/part0/基础知识#interview-promise\'>这里</a>获取更多信息。你必须是芬兰公民才能参与这些面试。"]}],"fr":[{"title":"Comment puis-je m\'inscrire au cours?","text":["Vous n\'avez pas à vous inscrire tant que vous ne voulez pas passer l\'examen du cours. Vous pouvez trouver plus d\'informations <a href=\'/fr/part0/informations_generales#parties-et-completion\'>ici</a>. <br><br>Pour le certificat de cours, l\'inscription n\'est pas nécessaire."]},{"title":"Combien de crédits compte le cours ?","text":["Le cours est de 5 à 14 crédits ECTS <a href=\'/fr/part0/informations_generales#parties-et-completion\'>selon le nombre d\'exercices renvoyés</a>. Après avoir terminé le cours, vous pouvez continuer à approfondir vos connaissances sur le sujet en participant au <a href=\'/fr/part0/informations_generales#projet-full-stack\'>projet Full Stack</a>."]},{"title":"Quelle est la date limite pour les exercices et l\'examen ?","text":["Vous pouvez compléter le cours à votre propre rythme. La date limite pour les exercices est le 1er mars 2023 à 23.59.59. <br><br>Si vous souhaitez des crédits universitaires ouverts, la date limite pour l\'examen est le 10 janvier 2023 à 23.59.59. N\'oubliez pas que vous devez vous inscrire à l\'examen au plus tard la veille de la date limite du 09.01.2023. Vous pouvez également passer l\'examen avant la date limite et continuer à terminer les exercices restants. Une fois que vous avez terminé, vous pouvez réclamer des crédits <a href=\'/fr/part0/informations_generales#comment-obtenir-vos-credits\'> ici</a>.<br><br> Pour le certificat de cours, l\'inscription et l\'examen ne sont pas nécessaires."]},{"title":"Comment soumettre les exercices ?","text":["Les exercices sont soumis à GitHub, et en marquant les exercices comme effectués dans le système de soumission d\'exercices. Vous pouvez en savoir plus <a href=\'/fr/part0/informations_generales#envoi-dexercices\'>ici</a>."]},{"title":"Dois-je soumettre chaque partie à un dépôt séparé?","text":["Non. Vous pouvez utiliser un ou plusieurs dépôts, le plus important est de nommer clairement tout ce qui se trouve dans ce dernier. "]},{"title":"Puis-je modifier une soumission ?","text":["Non. Tous les exercices d\'une partie doivent être soumis en même temps. Si vous avez mal marqué des exercices par accident, ou si vous avez mal écrit le nom du référentiel, envoyez un e-mail à matti.luukkainen@helsinki.fi ou un message dans Discord à <i>mluukkai</i>, indiquez votre nom d\'utilisateur GitHub et comment la soumission devrait être édité."]},{"title":"Quand et comment puis-je obtenir mes crédits ?","text":["Vous pouvez obtenir vos crédits après avoir soumis suffisamment d\'exercices pour réussir le cours, avoir réussi l\'examen du cours et nous avoir fait savoir via le système de soumission d\'exercices que vous êtes prêt pour le cours. La date limite est le 10 janvier 2023. En savoir plus <a href=\'/fr/part0/informations_generales#parties-et-completion\'>ici</a>. <br><br>Pour le cours, l\'inscription au certificat ou l\'examen ne sont pas nécessaires."]},{"title":"Est-ce que j\'obtiens un certificat après avoir terminé le cours?","text":["Oui! Vous pouvez télécharger le certificat après avoir terminé le cours à partir du système de soumission d\'exercices. Pour le certificat de cours, l\'inscription à l\'Open University et l\'examen ne sont pas nécessaires."]},{"title":"Dois-je m\'inscrire à Open University pour obtenir le certificat de cours?","text":["Pour le certificat de cours, l\'inscription à l\'Open University n\'est pas nécessaire. Vous pouvez télécharger le certificat après avoir terminé le cours à partir du système de soumission d\'exercices."]},{"title":"J\'ai commencé le cours l\'année dernière, comment dois-je continuer ?","text":["En savoir plus <a href=\'/fr/part0/informations_generales#approfondir-un-cours-deja-suivi\'>ici</a>"]},{"title":"J\'ai entendu dire que je pouvais obtenir un entretien d\'embauche en suivant le cours.","text":["C\'est vrai. Si vous terminez le cours avec des crédits complets et terminez les travaux pratiques avec 10 crédits, vous obtenez un entretien d\'embauche avec nos partenaires. En savoir plus <a href=\'/fr/part0/informations_generales#promesse-dentretien\'>ici</a>. Vous devez être résident finlandais pour participer à ces entretiens."]}],"ptbr":[{"title":"Quais são os pré-requisitos deste curso?","text":["Leia mais <a href=\'/ptbr/part0/informacoes_gerais#pre-requisitos\'>aqui</a>."]},{"title":"Quanto custa este curso?","text":["O curso é totalmente gratuito. Você pode obter um certificado e até mesmo créditos ECTS de graça da Universidade de Helsinque. Entre <a href=\'/ptbr/part0/informacoes_gerais#das-partes-e-conclusao\'>aqui</a> para ver mais informações."]},{"title":"Como eu me inscrevo no curso?","text":["Você não precisa se inscrever a não ser que queira fazer a prova do curso. Você pode encontrar mais informações <a href=\'/ptbr/part0/informacoes_gerais#das-partes-e-conclusao\'>aqui</a>. <br><br> Não é necessário se inscrever para obter o certificado do curso."]},{"title":"Quantos créditos vale o curso?","text":["O curso vale de 5 a 14 créditos ECTS <a href=\'/ptbr/part0/informacoes_gerais#das-partes-e-conclusao\'>dependendo da quantidade de exercícios enviados</a>. Depois de concluir o curso, você pode continuar a aprofundar seus conhecimentos sobre o assunto fazendo o projeto Full Stack de 1-10 créditos ECTS <a href=\'/ptbr/part0/informacoes_gerais#projeto-full-stack\'>aqui</a>."]},{"title":"Qual é o prazo para a entrega dos exercícios e a prova?","text":["Você pode completar o curso no seu próprio ritmo, e não há prazos para nada. O curso tem uma pausa de manutenção em março, mas isso não afeta muita coisa. Entre <a href=\'/ptbr/part0/informacoes_gerais#nao-ha-mais-versoes-anuais\'>aqui</a> para mais detalhes."]},{"title":"Como envio os exercícios?","text":["Os exercícios são enviadas para o GitHub e marcados como concluídos no sistema de envio de exercícios. Você pode ler mais sobre a forma de envio <a href=\'/ptbr/part0/informacoes_gerais#enviando-exercicios\'>aqui</a>."]},{"title":"Preciso enviar cada parte para um repositório separado?","text":["Não. Você pode usar um ou mais repositórios, contudo, o mais importante é nomear tudo de forma clara em um único repositório."]},{"title":"Posso editar um exercício já enviado?","text":["Não. Todas as tarefas de uma parte devem ser enviadas ao mesmo tempo. Se você marcou as tarefas incorretamente por acidente ou escreveu o nome do repositório incorretamente, envie um e-mail para matti.luukkainen@helsinki.fi ou mande uma mensagem no Discord para <i>mluukkai</i>, informando seu nome de usuário do GitHub e como a solução do exercício deve ser editado."]},{"title":"Quando e como posso obter meus créditos?","text":["Você pode obter seus créditos depois de enviar exercícios suficientes para passar no curso, passar na prova do curso e nos informar através do sistema de envio de exercícios que você já terminou o curso.<br><br>Não é necessário se inscrever ou fazer a prova para obter o certificado do curso."]},{"title":"Eu recebo um certificado ao concluir o curso?","text":["Sim! Você pode baixar o certificado após concluir o curso a partir do sistema de envio de exercícios. Não é necessário se inscrever na Universidade Aberta e nem fazer a prova para pegar o certificado do curso."]},{"title":"Devo me inscrever na Universidade Aberta para obter o certificado do curso?","text":["Não é necessário se inscrever na Universidade Aberta para obter o certificado do curso. Você pode baixar o certificado após concluir o curso a partir do sistema de envio de exercícios."]},{"title":"Eu comecei o curso no ano passado, como devo continuar?","text":["Leia mais <a href=\'/ptbr/part0/informacoes_gerais#aproveitamento-de-um-curso-concluido-anteriormente\'>aqui</a>"]},{"title":"Ouvi dizer que eu poderia conseguir uma entrevista de emprego ao completar o curso.","text":["É verdade. Se você completar o curso com todos os créditos e completar o trabalho prático com 10 créditos, você consegue uma entrevista de emprego com nossos parceiros. Leia mais <a href=\'/ptbr/part0/informacoes_gerais#promessa-de-entrevista\'>aqui</a>. Você precisa residir na Finlândia para participar dessas entrevistas."]}]}')}}]);
//# sourceMappingURL=2fbfd3663f260eb7b241895b0845dcc690f8d25c-aa594ab777570706b8af.js.map